import e2vdom

def on_compile(application, object, action_name, context, objects):
	result=objects
	for xobject in object.get_objects_list():
		result.append({"object": xobject})
	return result

class VDOM_container(VDOM_object):

	def render(self, parent, contents=""):

		if self.securitycode:
			self.visible = "0"
			if session["SecurityCode"] and str(session["SecurityCode"]) in self.securitycode.split(";"):
				self.visible = "1"

		display = u" display:none; " if self.visible == "0" else u""

		e2vdom.process(self, parent)

		if self.overflow == "1":
			overflow = u"hidden"
		elif self.overflow == "2":
			overflow = u"scroll"
		elif self.overflow == "3":
			overflow = u"visible"
		else:
			overflow = u"auto"

		height = u"height: %spx;" % self.height if self.heightauto == "0" else u""

		style = u"""{display} z-index: {zind}; position: {pos}; top: {top}px; left: {left}px;
					width: {width}px; overflow: {overflow}; {height}"""\
				.format(display = display, zind = self.zindex, pos = self.position, 
						top = self.top, left = self.left, width = self.width, overflow = overflow, height = height)

		id = u"o_" + (self.id).replace('-', '_')
		footer = u"""rel="footer" """ if self.footer == "1" else u""
		classname = u"""class="%s" """ % self.classname if self.classname else u""

		if self.titlewrap == "0":
			title_tag = u""
			cont_tag = u"%s" % contents
		else:
			title_tag = u"""<div class="title"><div><h{twrap}>{title}</h{twrap}></div></div>"""\
						.format(twrap = self.titlewrap, title = self.title)
			cont_tag = u"""<div class="content">%s</div>""" % contents

		result = u"""<div {footer} id="{id}" style="{style}" {classname}>{title_tag}{cont_tag}</div>"""\
				.format(footer =  footer, id = id, style = style, classname = classname, title_tag = title_tag, cont_tag = cont_tag)

		return VDOM_object.render(self, parent, contents=result)


	def wysiwyg(self, parent, contents=""):
		result =u"""<container id="{id}" visible="{vis}" zindex="{zind}" hierarchy="{hierarchy}" order="{order}" 
							top="{top}" left="{left}" width="{width}" height="{height}">
						<svg>
							<rect x="0" y="0" width="{width}" height="{height}" fill="#EEEEEE"/>
						</svg>{contents}
					</container>
				""".format(id = self.id, vis = self.visible, zind = self.zindex, 
						hierarchy = self.hierarchy, order = self.order, 
						top = self.top, left = self.left, width = self.width, height = self.height, 
						contents = contents)

		return VDOM_object.wysiwyg(self, parent, contents=result)


def set_attr(app_id, object_id, param):
	object = application.objects.search(object_id)

	if object.parent and object.parent.type.class_name == "VDOM_tabview" and object.attributes.lockposition == "1" and int(object.attributes.top) != 20 and int(object.attributes.left) != 1:
		top_container = 20
		left_container = 1
		object.set_attributes({"left": left_container, "top": top_container})

	return ""

